(579, '1', 'XCPRO4924979012', 114, 'xfactor project 01', 'singapore', 'SHOP REG REQUIRED', '301 adheeshwar nikunj apartments\nram nagar alambagh\nlucknow', 'NOT APPLICABLE', 'NOT APPLICABLE', 'NOT APPLICABLE', 'NOT APPLICABLE', '2021-02-13 00:00', '2021-03-31 18:00', 'CORPORATE', '<p>checking the functionality</p>\n', 'WhatsApp_Image_2020-11-06_at_3_35_14_PM.jpeg', 'yes', 'hermes', 'khsdjkh', '1232434', 'SINGAPORE', 1242, 'shweta', '221005', 'ANDORRA', '09654961533', 'navneetpandey94@gmail.com', 'dsff', '{\"salutation\":\"1\",\"gender\":\"1\",\"first_name\":\"1\",\"last_name\":\"1\",\"username\":\"1\",\"email\":\"1\",\"country_code\":\"1\",\"mobile\":\"1\",\"did\":\"1\",\"tel\":\"1\",\"extension\":\"1\",\"company_name\":\"1\",\"company_address\":\"1\",\"designation\":\"1\",\"remark_1\":0,\"remark_2\":0,\"remark_3\":0,\"remark_4\":0,\"remark_5\":0}', 'http://13.235.169.150/XFactor/project/register_page/xmanageici1f0ixac', 'http://13.235.169.150/XFactor/project/register_page/xmanageici1f0ixac', 'NIL', 'http://13.235.169.150/XFactor/project/register_page/xmanageici1f0ixac', 2, NULL, '4', 0, '2020-10-16 15:35', '27.97.242.194', 'XP114', 'administrator', '2021-03-31 14:41', '49.36.155.11', 'XP76868768686786787', 'xmanage_admin'),
(582, '2', 'XCPRO2701033497', 114, 'DEMO TESTING PROJECT', 'test venue', 'VENUE REG REQUIRED', 'singapore', 'NOT APPLICABLE', 'NOT APPLICABLE', 'NOT APPLICABLE', 'NOT APPLICABLE', '2020-11-14 00:00', '2020-11-27 00:00', 'CONSUMER', '<p>To set the &ldquo;From:&rdquo; email address to something other than the WordPress default sender, or to add &ldquo;Cc:&rdquo; and/or &ldquo;Bcc:&rdquo; recipients, you must use the&nbsp;<tt>$headers</tt>&nbsp;argument.</p>\r\n\r\n<p>To set the &ldquo;From:&rdquo; email address to something other than the WordPress default sender, or to add &ldquo;Cc:&rdquo; and/or &ldquo;Bcc:&rdquo; recipients, you must use the&nbsp;<tt>$headers</tt>&nbsp;argument.</p>\r\n\r\n<p><tt>$headers</tt>&nbsp;can be a string or an array, but it may be easiest to use in the array form. To use it, push a string onto the array, starting with &ldquo;From:&rdquo;, &ldquo;Bcc:&rdquo; or &ldquo;Cc:&rdquo; (note the use of the &ldquo;:&rdquo;), followed by a valid email address.</p>\r\n\r\n<p>When you are using the array form, you do not need to supply line breaks (<tt>&quot;\\n&quot;</tt>&nbsp;or&nbsp;<tt>&quot;\\r\\n&quot;</tt>). Although the function can handle multiple emails per line, it may simply be easier to push each email address separately onto the&nbsp;<tt>$headers</tt>&nbsp;array. The function will figure it out and will build the proper Mime header automagically. Just don&rsquo;t forget that each string you push must have the header type as the first part of the string (&ldquo;From:&rdquo;, &ldquo;Cc:&rdquo; or &ldquo;Bcc:&rdquo;)</p>\r\n\r\n<p><tt>$headers</tt>&nbsp;can be a string or an array, but it may be easiest to use in the array form. To use it, push a string onto the array, starting with &ldquo;From:&rdquo;, &ldquo;Bcc:&rdquo; or &ldquo;Cc:&rdquo; (note the use of the &ldquo;:&rdquo;), followed by a valid email address.</p>\r\n\r\n<p>When you are using the array form, you do not need to supply line breaks (<tt>&quot;\\n&quot;</tt>&nbsp;or&nbsp;<tt>&quot;\\r\\n&quot;</tt>). Although the function can handle multiple emails per line, it may simply be easier to push each email address separately onto the&nbsp;<tt>$headers</tt>&nbsp;array. The function will figure it out and will build the proper Mime header automagically. Just don&rsquo;t forget that each string you push must have the header type as the first part of the string (&ldquo;From:&rdquo;, &ldquo;Cc:&rdquo; or &ldquo;Bcc:&rdquo;)</p>\r\n', 'plan_4.jpg', 'yes', 'xfactor', 'singapore', '76778782', 'FALKLAND ISLANDS (MALVINAS)', 0, 'user test', '568768', 'ANTIGUA AND BARBUDA', '767887987893', 'test@yopmail.com', '', '{\"salutation\":\"1\",\"gender\":\"1\",\"first_name\":\"1\",\"last_name\":\"1\",\"username\":\"1\",\"email\":\"1\",\"country_code\":\"1\",\"mobile\":\"1\",\"did\":\"1\",\"tel\":\"1\",\"extension\":\"1\",\"company_name\":\"1\",\"company_address\":\"1\",\"designation\":\"1\",\"remark_1\":0,\"remark_2\":0,\"remark_3\":0,\"remark_4\":0,\"remark_5\":0}', 'http://13.235.169.150/XFactor/project/register_page/xmanagezbczpipozn', 'http://13.235.169.150/XFactor/project/check_in_page/xmanagezbczpipozn', 'NIL', 'http://13.235.169.150/XFactor/project/register_page/xmanagezbczpipozn', NULL, NULL, '4', 0, '2020-10-23 19:03', '117.96.170.123', 'XP114', 'administrator', '2020-11-12 19:44', '49.36.149.190', 'XP114', 'Administrator'),
